(2, 'firoh', 'Friday, 21 June 2024 | 13:11', 'Pantai Pink', 2, 'Jika mendengar nama Pantai Pink, mayoritas masyarakat akan teringat dengan Pink Beach di Lombok, Nusa Tenggara Barat (NTB). Namun ternyata, ada Pantai Pink di Bima, NTB yang tidak kalah menawan. Pantai Pink berada di ujung timur Pulau Sumbawa. Tepatnya di Kecamatan Lambu, Kabupaten Bima, NTB.', );
