INSERT INTO `artikel` (`id_artikel`, `penulis`, `tanggal`, `judul`, `id_kategori`, `isi`, `gambar`) VALUES
(4, 'cace', 'Friday, 21 June 2024 | 13:15', 'Pantai Lariti', 3, 'Pada zaman dahulu, Pantai Lariti juga dikenal sebagai Pantai Lampa Jara, yang berarti jalan kuda, dikutip dari Tribun Travel. Sebab, pantai ini digunakan untuk pelepasan kuda termasuk kuda milik para sultan Kerajaan Bima. Laut di lepas Pantai Lariti terbelah dengan panjang sekitar 150 meter dan lebar tujuh meter, dikutip dari situs Dinas Pariwisata NTB. Laut yang terbelah tersebut menampakkan jalan berupa hamparan pasir yang bersih. Fenomena laut terbelah tersebut seolah mengingatkan kita dengan kisah Nabi Musa saat dikejar tentara Firaun. Menariknya, wisatawan yang berkunjung bisa merasakan sensasi berjalan di tengah dua sisi lautan tersebut, dilansir dari Tribun Travel. Jalan yang diapit dua lautan tersebut menghubungkan sisi timur Pantai Lariti, dengan pulai kecil di seberangnya yakni Pulau Paliman.\r\n\r\n', );

