(1, 'budaya', 'rimpu merukapan suata tradisi atau sebuah pakain untuk wanita bima'),
(2, 'wisata', 'Pantai Pink berada di ujung timur Pulau Sumbawa, tepatnya di Kecamatan Lambu, Kabupaten Bima, NTB. Sesuai namanya, daya tarik Pantai Pink Bima adalah hamparan pasir berwarna merah muda alias pink, seperti dikutip dari Tribun Travel, Rabu (7/10/2022). Butiran pasir berwarna mera muda itu sangat halus. Menariknya, Pantai Pink Bima dikelilingi dengan bukit sehingga menambah daya tariknya. Gradasi antara pasir berwarna pink, air laut biru jernih, dan perbukitan hijau, menghasilkan panorama yang sangat eksotis. Bagi pencinta panorama bawah laut, bisa menjajal snorkeling di Pantai Pink Bima. Di sekitar pantai, terdapat sejumlah gazebo yang dapat digunakan wisatawan untuk duduk santai. '),
(3, 'wisata', 'Salah satu pantai yang populer di Bima adalah Pantai Lariti yang berlokasi di Desa Soro, Kecamatan Lambu, Kabupaten Bima. Daya tarik utama Pantai Lariti adalah fenomena laut terbelah, dikutip dari situs Dinas Pariwisata NTB. Laut di lepas Pantai Lariti terbelah dengan panjang sekitar 150 meter dan lebar tujuh meter. Laut yang terbelah tersebut menampakkan jalan berupa hamparan pasir yang bersih.  Menariknya, wisatawan yang berkunjung bisa merasakan sensasi berjalan di tengah dua sisi lautan tersebut, dilansir dari Tribun Travel. Jalan yang diapit dua lautan tersebut menghubungkan sisi timur Pantai Lariti, dengan pulai kecil di seberangnya yakni Pulau Paliman. Fenomena laut terbelah di Pantai Lariti tersebut disebabkan oleh surutnya air laut, yang hanya terjadi pada waktu-waktu tertentu. Biasanya, air laut di Pantai Lariti akan surut pada pukul 10.00 WITA dan 15.30 WITA. '),
(4, 'b', 'Uma Lengge merupakan bangunan tradisional khas suku mbojo yang berada di Kecamatan Wawo, Kabupaten Bima, Nusa Tenggara Barat. Dalam Bahasa Mbojo, Uma berarti “rumah” dan Lengge berarti “bentuk tinggi dan mengerucut”.');

